  border-top: 1px solid grey;
  margin: 3vh;
`;



const Contents=() =>{
    return(
        <StyledDiv>
            <img src ="../img/main1.jpg" />
            <h1>환경을 버리는<br/> 일회용컵 BYE!</h1>
            <h1>환경을 살리는 <br/> 다회용컵 서비스 HELLO!</h1>
            <h3>리에이블 서비스는 <br/>다회용컵 순환 시스템으로 <br/> </h3>

        </StyledDiv>
    );
}

export default Contents;
